import React from 'react';

const Finish = props => {
    return (
        <div>
            <h2>{props.game.isWin}</h2>
            <h2>{props.game.countLose} - {props.game.countWin}</h2>
            <button onClick={()=>{props.changePage}}>Again?</button>
        </div>
    );
};

export default Finish;
